// src/pages/ResourceListPage.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const ResourceListPage = ({ endpoint, title }) => {
  const [resources, setResources] = useState([]);

  useEffect(() => {
    axios.get(`http://localhost:5000/${endpoint}`)
      .then(response => setResources(response.data))
      .catch(error => console.error(error));
  }, [endpoint]);

  return (
    <div className="p-6">
      <h1 className="text-4xl font-bold mb-4">{title}</h1>
      {resources.map(resource => (
        <div key={resource._id} className="mb-4">
          <h2 className="text-2xl font-bold">{resource.resourceTitle}</h2>
          <a href={resource.resourceUrl} className="text-blue-500 hover:underline">{resource.resourceUrl}</a>
        </div>
      ))}
    </div>
  );
};

export default ResourceListPage;
